/****** Object:  View [dbo].[SchemeDetails]    Script Date: 04/29/2013 20:33:58 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'[dbo].[SchemeDetails]'))
EXEC dbo.sp_executesql @statement = N'--- Alter View Scheme Details, Add School      
CREATE VIEW [dbo].[SchemeDetails]      
AS      
SELECT s.SchemeID,     
  s.Name SchemeName,     
  s.Description,    
  s.OwnerUserId,    
  ISNULL(u1.UserName,'''') OwnerName,    
  s.CoordinatorUserId,    
  ISNULL(u2.UserName, '''') CoordinatorName,    
  s.ModalityID,    
  m.Name ModalityName,
  ss.SchoolID,
  ISNULL(sc.Name, '''') SchoolName
FROM Scheme s  
INNER JOIN Modality m ON s.ModalityID = m.ModalityID    
LEFT JOIN Users u1 ON u1.UserId = s.OwnerUserId    
LEFT JOIN Users u2 ON u2.UserId= s.CoordinatorUserId 
LEFT JOIN [School-Scheme] ss ON ss.SchemeID = s.SchemeID 
LEFT JOIN School sc ON sc.SchoolID = ss.SchoolID
--- Add primary key to table school - scheme
'
GO
